function Players() {
    return (
        <div id="players-main">
            <h1>Players</h1>
            {fetchData().map((player) => {
                const { name, price } = player;
                return (
                    <div>
                        <h3>{name}</h3>
                        <h3>{price}</h3>
                    </div>
                );
            })}
        </div>
    )
}

function fetchData() {
    fetch('http://127.0.0.1:8000/api/app/')
    .then(response => response.json())
    .then((data) => {
        return data;
    });
}

export default Players;
